        labels: ['L', 'M', 'M', 'J', 'V', 'S'],
        datasets: [
            {
                label: '# s',
                data: [100, 200, 750, 770, 1000, 1100, 1100],
                fill: false,
                backgroundColor: 'rgb(255, 99, 132)',
                borderColor: 'rgba(255, 99, 132, 0.2)',
            },
        ],
    };

    const options = {
        scales: {
            yAxes: [
                {
                    ticks: {
